Here's a Python code snippet that uses the concept of group theory to solve the given problem. This code defines a `Group` class with methods to check if two elements commute and if the group is abelian (commutative).

```python
class Group:
    def __init__(self, elements, operation):
        self.elements = elements
        self.operation = operation

    def __contains__(self, element):
        return element in self.elements

    def commute(self, a, b):
        return self.operation(a, b) == self.operation(b, a)

    def is_abelian(self):
        for a in self.elements:
